import React from 'react';
import './App.css';
import Home from './Components/Home';
import Members from './Components/Members';
import Events from './Components/Events';

function App() {
  return (
    <div className="App">
      <Header/>
      <Home/>
      <Members/>
      <Events/>
      <Footer/>
    </div>
  );
}

export default App;
